INSERT INTO "exercise_plans" VALUES (1,'Push-Ups for Upper Body Strength','Start in a high plank with hands shoulder-width apart. Keep your core tight as you lower your body until your chest is just above the floor, then push back up. Focus on steady movement and controlled breathing.');
INSERT INTO "exercise_plans" VALUES (2,'Bodyweight Squats for Lower Body','Stand with feet shoulder-width apart, toes slightly outward. Bend at the knees and hips to lower into a squat, keeping your chest lifted. Drive through your heels to return to standing, maintaining proper form throughout.');
INSERT INTO "exercise_plans" VALUES (3,'Forearm Plank for Core Stability','Begin in a push-up position but rest on your forearms with elbows under your shoulders. Keep your body in a straight line from head to heels. Engage your abs and glutes, holding this position without letting your hips drop.');
INSERT INTO "exercise_plans" VALUES (4,'Walking Lunges for Leg Strength','Step forward with one foot and bend both knees to about 90 degrees, lowering your body. Push off your front heel to bring the back leg forward into the next lunge. Keep your upper body tall and core engaged.');
INSERT INTO "exercise_plans" VALUES (5,'Glute Bridges for Posterior Chain','Lie on your back with knees bent and feet flat. Press through your heels to lift your hips until your body forms a straight line from shoulders to knees. Squeeze your glutes at the top before lowering back down.');
INSERT INTO "exercise_plans" VALUES (6,'Shoulder Taps for Upper Body and Core','Assume a high plank position, wrists under shoulders. Lift one hand off the floor to tap the opposite shoulder, then return it to the starting position. Alternate sides, keeping hips as still as possible to engage your core.');
INSERT INTO "exercise_plans" VALUES (7,'Burpees for Full-Body Conditioning','Begin standing. Lower your hands to the floor and kick your feet back into a plank, then immediately lower your chest to the floor. Push back up, jump your feet toward your hands, and explode into a jump with arms overhead.');
INSERT INTO "exercise_plans" VALUES (8,'Russian Twists for Obliques','Sit on the floor with knees bent and feet elevated (if possible). Lean back slightly and hold your hands together in front of your chest. Twist your torso to one side, then to the other, keeping your core tight throughout.');
INSERT INTO "exercise_plans" VALUES (9,'Superman for Lower Back Strength','Lie on your stomach with arms extended. Simultaneously lift your arms, chest, and legs off the ground, squeezing your lower back and glutes. Hold for a moment, then gently lower back to the floor.');
INSERT INTO "exercise_plans" VALUES (10,'Standing Cool-Down Stretches','Finish your workout with full-body stretches, including shoulder rolls, side bends, quad stretches, and hamstring stretches. Hold each stretch for 20–30 seconds, focusing on slow, controlled breathing to help your body recover.');
