INSERT INTO "forum_posts" VALUES (1,4,'Long term health','Remember, the goal is long-term health, not perfection. How can I support you in staying consistent?','Discussion','2025-03-11 02:14:55');
INSERT INTO "forum_posts" VALUES (2,13,'The Sunrise Starter','Begin your day with light cardio, gentle stretching, and a quick core workout to get energized.','Exercise Plan','2024-09-06 05:49:19');
INSERT INTO "forum_posts" VALUES (3,4,'What are you proud of?','I encourage patients to celebrate small victories. What’s one thing you’re proud of this week?','Discussion','2024-05-07 05:22:46');
INSERT INTO "forum_posts" VALUES (4,28,'Desk Warrior''s Movement Plan','Perfect for office workers: chair squats, desk push-ups, and standing stretches every hour.','Exercise Plan','2024-11-22 18:59:41');
INSERT INTO "forum_posts" VALUES (5,4,'Tips for recovery','For those recovering from injuries, gentle stretching or swimming can be great options. How are you adapting your plan?','Discussion','2024-12-12 00:35:28');
INSERT INTO "forum_posts" VALUES (6,4,'Consistency is key','Many patients find it challenging to stick to an exercise plan initially, but consistency is key. How are you all managing your routines?','Discussion','2024-11-19 19:21:56');
INSERT INTO "forum_posts" VALUES (7,10,'Weekend Warrior: Intense 45-Minute Workout','A mix of HIIT, strength training, and yoga to supercharge your weekends.','Exercise Plan','2024-09-17 10:42:37');
INSERT INTO "forum_posts" VALUES (8,19,'The Couch-to-5K Plan','A 6-week program combining walking, jogging, and running intervals to gradually improve stamina.','Exercise Plan','2024-06-13 10:35:46');
INSERT INTO "forum_posts" VALUES (9,4,'Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus.','Remember, it''s normal to feel some muscle soreness when starting a new plan. Let me know if it feels excessive or if you need adjustments.','Discussion','2024-10-10 23:53:20');
INSERT INTO "forum_posts" VALUES (10,4,'The Core Crusher Challenge','Focused on abs and lower back: planks, crunches, and bridges to build a strong foundation.','Exercise Plan','2024-07-08 09:57:12');
INSERT INTO "forum_posts" VALUES (11,19,'Mindful Movers Yoga Plan','A 30-minute daily yoga practice designed to improve flexibility, mindfulness, and balance.','Exercise Plan','2024-06-12 22:26:46');
INSERT INTO "forum_posts" VALUES (12,7,'Tips for motivation','For those struggling with motivation, try setting small, achievable goals. What’s one thing you’ve accomplished this week?','Discussion','2024-12-29 12:29:45');
INSERT INTO "forum_posts" VALUES (13,25,'Strength Training Simplified: Beginner''s Guide','Basic weightlifting exercises with dumbbells, targeting all major muscle groups.','Exercise Plan','2024-03-20 21:32:52');
INSERT INTO "forum_posts" VALUES (14,13,'Make exercise fun','I’ve noticed some patients benefit from pairing exercise with a favorite activity, like listening to music or podcasts. What works for you?','Discussion','2024-11-03 01:10:04');
INSERT INTO "forum_posts" VALUES (15,16,'Total Body Tune-Up: 7-Day Program','Combine cardio, strength, and flexibility training for a comprehensive weekly workout schedule.','Exercise Plan','2024-09-18 18:51:13');
INSERT INTO "forum_posts" VALUES (16,25,'Feeling tired?','If you''re feeling fatigued, ensure you''re balancing rest and activity. How are you pacing yourself?','Discussion','2024-05-26 06:23:46');
INSERT INTO "forum_posts" VALUES (17,7,'Hydration and nutrition','Hydration and nutrition play a huge role in exercise recovery. Are you staying on top of these?','Discussion','2025-02-21 10:05:47');
INSERT INTO "forum_posts" VALUES (18,10,'HIIT for Busy Bees','A quick 20-minute high-intensity interval training plan to fit into packed schedules.','Exercise Plan','2024-08-17 16:25:53');
INSERT INTO "forum_posts" VALUES (19,7,'The Gentle Stretch and Mobility Plan','Ideal for those recovering from injuries: stretches, light movement, and balance exercises.','Exercise Plan','2024-10-23 13:31:25');
INSERT INTO "forum_posts" VALUES (20,22,'Joint pain','Some patients worry about joint pain during workouts. If this applies to you, let’s discuss modifications to your plan.','Discussion','2024-07-22 08:01:48');
INSERT INTO "forum_posts" VALUES (21,1,'Exercise for beginners','I often recommend starting with low-impact exercises for beginners. How are you finding the intensity of your current plan?','Discussion','2025-03-04 12:21:03');
INSERT INTO "forum_posts" VALUES (22,16,'Track your progress!','Tracking progress can be motivating. Have you noticed any improvements in strength, stamina, or mood?','Discussion','2025-02-07 16:50:02');
INSERT INTO "forum_posts" VALUES (23,1,'Exercising while busy','For those with busy schedules, even short bursts of activity can make a difference. How are you fitting exercise into your day?','Discussion','2024-12-22 00:18:47');
INSERT INTO "forum_posts" VALUES (24,25,'Family Fun Fitness Plan','Group-friendly workouts like relay races, bodyweight exercises, and interactive games for all ages.','Exercise Plan','2025-01-26 05:34:40');
INSERT INTO "forum_posts" VALUES (25,28,'Pilates Powerhouse Program','A 4-week program focusing on core strength, posture, and controlled movements.','Exercise Plan','2024-12-15 04:13:59');
INSERT INTO "forum_posts" VALUES (26,22,'Don''t push yourself (too much)','It’s important to listen to your body. If you’re experiencing discomfort, let’s adjust your plan together.','Discussion','2024-07-22 01:06:48');
INSERT INTO "forum_posts" VALUES (27,16,'When to exercise?','Patients often ask about the best time to exercise. My advice: choose a time that fits your energy levels and schedule. What’s working for you?','Discussion','2024-12-21 05:13:09');
INSERT INTO "forum_posts" VALUES (28,1,'Any positive changes?','If you’re feeling discouraged, remember that progress isn’t always linear. What’s one positive change you’ve noticed so far?','Discussion','2024-11-30 08:46:04');
INSERT INTO "forum_posts" VALUES (29,13,'Outdoor Adventure Exercise Plan','Incorporate hiking, biking, and outdoor circuit training into your fitness routine while enjoying nature.','Exercise Plan','2024-11-15 07:39:39');
INSERT INTO "forum_posts" VALUES (30,4,'Exercising is fun with friends','Group activities or classes can boost motivation. Have you tried exercising with friends or family?','Discussion','2024-10-18 15:04:23');
